import React from 'react';
import { ToastContainer } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
//import {ProductProvider} from '../src/Context/Context'
import 'react-toastify/dist/ReactToastify.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AdminHandleuserPage from './Components/';
import AdminDash from './Components/Admin/AdminDash';
import AdminAddProducts from './Components/Admin/AdminAddProducts'
import AdminViewProducts from './Components/Admin/AdminViewProducts';
import AdminCatogory from './Components/Admin/AdminCatogory'
import AdminSubCategories from './Components/Admin/AdminSubCategory';

function App() {

  return (
    <div >
      {/* <ProductProvider> */}
      <Router>
        <Routes>
        <Route exact path="/admin-dash" element={<AdminDash />} />
          <Route exact path="/admin-handle-users" element={<AdminHandleuserPage />} />
          <Route exact path="/admin-add-products" element={<AdminAddProducts />} />
          <Route exact path="/admin-products" element={<AdminViewProducts />} />
          <Route exact path="/admin-catogory" element={<AdminCatogory />} />
          <Route exact path="/admin-subCatogory" element={<AdminSubCategories />} />
        </Routes>
      </Router>
      <ToastContainer />
      {/* </ProductProvider> */}
    </div>

  );
}

export default App;
